  [],\n\t\"revision_timestamp\": \"2016-05-25T00:52:47.756364\",\n\t\"name\": \"integrated-reporting-information-system\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Integrated Reporting Information System
  (IRIS) is a flexible and scalable web-based system that supports post operational
  analysis and evaluation of the National Airspace System (NAS) performance and Traffic
  Management Initiatives (TMI), such as Ground Delay Programs (GDP), Airspace Flow
  Programs (AFP) and Ground Stops (GS). IRIS users have access to near real-time Traffic
  Flow Management System (TFMS) data and a rolling 45-day historical data set for
  the entire NAS. IRIS leverages some of the latest web technologies currently available,
  to provide a wide variety of dynamic, interactive and summary reports. These reports
  provide users with access to both summary and aggregate metrics, and a way to drill-down
  to detailed, individual flight  information.\",\n\t\"license_title\": \"Other License
